import axios from "axios";

const url = "https://api.github.com/users/example";

const Fetch = async () => {
  try {
    const { name } = await axios.get(url);
    return JSON.stringify({ name });
  } catch (error) {
    console.log(error);
  }
};

export default Fetch;
